import logo from './logo.svg';
import './App.css';

const title = <h3>To do List</h3>

function setTitle(string) {
  return <h3>{string}</h3>
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {setTitle('Eita')}
      </header>
    </div>
  );
}

export default App;
